    twice-per-year collection of bulk items. nBulk Items Include:nu2022 Doorsnu2022
    Carpetnu2022 Furniturenu2022 Appliances (remove doors)nu2022 Passenger car tires
    (remove rims; limit eight tires per household)nu2022 Lawn mowers (remove gas/oil)nu2022
    Railroad ties (cut in half)nu2022 Palletsnu2022 Rolled fencingnu2022 Nail-free lumbernThis
    list is not all inclusive, please visit the What Do I Do With..? page (on the City
    of Austin, Austin Resource Recovery website) to see if your item is collected during
    bulk collection.nBulk Item Collection Crews Cannot Collect:nu2022 Brush, household
    trash, cardboard boxes, hazardous materials, mirrors, automotive chassis and bodies,
